import React from 'react';
import Particles from 'react-tsparticles';

const Particle = () => {
  return (
    <div>
      <Particles style={{ position: 'fixed', width: '100%', height: '100%', zIndex: -1 }}
        options={{
          background: {
            color: {
              value: '#333333',
            },
          },
          fullScreen: {
            enable: true,
            zIndex: 999,
          },
          interactivity: {
            detectsOn: 'window',
            events: {
              onHover: {
                enable: true,
                mode: 'repulse',
              },
            },
          },
          particles: {
            color: {
              value: '#ffffff',
            },
            links: {
              color: '#ffffff',
              distance: 150,
              enable: true,
              opacity: 0.5,
              width: 1,
            },
            collisions: {
              enable: true,
            },
            move: {
              direction: 'none',
              enable: true,
              outMode: 'bounce',
              random: false,
              speed: 2,
              straight: false,
            },
            number: {
              density: {
                enable: true,
                value_area: 800,
              },
              value: 80,
            },
            opacity: {
              value: 0.5,
            },
            shape: {
              type: 'circle',
            },
            size: {
              random: true,
              value: 5,
            },
          },
        }}
      />
    </div>
  );
};

export default Particle;
